import Navbar from './components/Navbar';
import Home from './components/Home';
import Projects from './components/Projects';

import './App.css';
import './Navbar.css';
import './Home.css';
import './Skills.css';
import './Projects.css';
import Skills from './components/Skills';

function App() {
  return (
    <main className='background'>
      <Navbar />
      <div className='padding'>
      <Home />
      <Projects />
      <Skills />
      </div>
    </main>
  );
}

export default App;
